-- ----------------------------
-- Records of advertiser_info
-- ----------------------------
INSERT INTO `advertiser_info` VALUES (1, '电影《破局》上映了！！', '<p><strong>剧情介绍</strong></p><p><br></p><p>在不普通的一天里，高见翔警官先是历经了老母亲去世的打击，然后又被告知因疑似受贿而不得不接受配合，调查取证。在奔丧的路上，他又意外的撞到了行人，为了逃避责任，他只能手忙脚乱的毁尸灭迹。他以为生活可以回归到波澜不惊，却不料，他撞死的其实是一名通缉犯，而驾车逃逸的他也同样被警方盯上。与此同时，一个神秘电话打来，高警官惊觉，这一切竟然是个阴谋，而他已经深陷迷局。</p><p><br></p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p>', '2020-11-07 16:16:50');
INSERT INTO `advertiser_info` VALUES (2, '电影《美人鱼》即将上映！', '<p>《美人鱼》是由<a href=\"https://baike.baidu.com/item/%E4%B8%AD%E5%9B%BD%E7%94%B5%E5%BD%B1%E8%82%A1%E4%BB%BD%E6%9C%89%E9%99%90%E5%85%AC%E5%8F%B8/9119953\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">中国电影股份有限公司</a>、星辉海外有限公司等出品的爱情喜剧片，由<a href=\"https://baike.baidu.com/item/%E5%91%A8%E6%98%9F%E9%A9%B0/169917\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">周星驰</a>执导兼编剧，<a href=\"https://baike.baidu.com/item/%E9%82%93%E8%B6%85/5681\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">邓超</a>、<a href=\"https://baike.baidu.com/item/%E7%BD%97%E5%BF%97%E7%A5%A5/140514\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">罗志祥</a>、<a href=\"https://baike.baidu.com/item/%E5%BC%A0%E9%9B%A8%E7%BB%AE/8785636\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">张雨绮</a>、<a href=\"https://baike.baidu.com/item/%E6%9E%97%E5%85%81/16506430\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">林允</a>领衔主演<span style=\"color: rgb(51, 102, 204);\">&nbsp;[1]</span><span style=\"color: rgb(19, 110, 194);\">&nbsp;</span>&nbsp;。</p><p><br></p><p>该片讲述了富豪<a href=\"https://baike.baidu.com/item/%E5%88%98%E8%BD%A9/19376012\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">刘轩</a>与为了拯救同族前往刺杀他的美人鱼珊珊坠入爱河，谱写了一段人鱼爱情童话的故事。该片于2016年2月8日在中国内地、香港同步上映。</p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p>', '2020-11-07 17:00:13');
INSERT INTO `advertiser_info` VALUES (3, '系统公告测试', '<p>这是系统公告，管理员可以在后台修改</p><p><br></p><p>666</p><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p>', '2021-07-03 19:24:27');

